script: |
  super -f text -I q12377.spq | sort > q12377.out

inputs:
  - name: q12377.spq
    data: |
      SELECT col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col2 NOT BETWEEN ( + - col2 * + col1 / - + col1 ) AND + col0 - - + col0;
  - name: tab1

outputs:
  - name: q12377.out
    data: |
      14
      47
      5
